import {DELETE_NOTE, STORE_NOTES} from './noteTypes';

export const deleteNote = (id='175') =>{
    return {
        type: DELETE_NOTE,
        payload : id,
        user : 'saikiran'
    }
}
export const storeNotes = (notes) =>{
    return {
        type : STORE_NOTES,
        payload : notes
    }
}
